import "./App.css";
import * as React from "react";
import TextField from "@mui/material/TextField";
import Autocomplete from "@mui/material/Autocomplete";
import Toolbar from "@mui/material/Toolbar";
import axios, * as others from "axios";
function App() {
  const [selectedVendor, setSelectedVendor] = React.useState("");
  const [optionsVendor, setOptionsVendor] = React.useState([]);
  const [selectedProduct, setSelectedproduct] = React.useState("");
  const [optionsProduct, setOptionsProduct] = React.useState([]);

  React.useEffect(() => {
    const fetchVendors = async () => {
      axios.get("/api/vendors").then(
        (response) => {
          console.log(response);
          if (response.status === 200) {
            setOptionsVendor(response.data);
            console.log(response.data);
          } else {
            console.log(`Status code ${response.status}`);
          }
        },
        (error) => {
          console.log(error);
        }
      );
    };
    fetchVendors();
  }, []);
  const fetchProducts = async (data) => {
    axios.get("/api/vendors").then(
      (response) => {
        console.log(response);
        if (response.status === 200) {
          setOptionsVendor(response.data);
          console.log(response.data);
        } else {
          console.log(`Status code ${response.status}`);
        }
      },
      (error) => {
        console.log(error);
      }
    );
  };

  return (
    <Toolbar>
      <Autocomplete
        disablePortal
        id="combo-box-demo"
        options={optionsVendor.map((item) => item.name)}
        sx={{ width: 300 }}
        renderInput={(params) => <TextField {...params} label="name" />}
        onChange={(event, value) => {
          console.log(value);
          setSelectedVendor(value);
        }}
      />
      <Autocomplete
        disablePortal
        id="combo-box-demo"
        options={optionsVendor.map((item) => item.name)}
        style={{
          cursor: "pointer",
          border: "1px solid #1a202c",
          padding: "8px",
          minWidth: "64px",

          background: "transparent",

          transition: "all 0.1s ease-in",
        }}
        renderInput={(params) => <TextField {...params} label="name" />}
        onChange={(event, value) => {
          console.log(value);
          setSelectedVendor(value);
        }}
      />
    </Toolbar>
  );
}

export default App;
